import React, {Component} from "react";
import {
    UncontrolledDropdown,
    DropdownToggle,
    DropdownMenu,
    DropdownItem
} from "reactstrap";
import ReactCountryFlag from "react-country-flag";
import {bindActionCreators} from "redux";
import {addUser, getUsers} from "../../redux/users/actions";
import {connect} from "react-redux";


class ThemeNavbar extends Component {
    constructor(props) {
        super(props);

        this.state = {
            languages : [
                { name: 'English', code: 'en' },
                { name: 'French', code: 'fr' },
                { name: 'Spanish', code: 'es' }
            ]
        };

    }
    render() {
        console.log(this.props)
        return (
            <UncontrolledDropdown nav inNavbar className="pr-1">
                <DropdownToggle nav>
                    <ReactCountryFlag code="us" svg/> EN
                </DropdownToggle>
                <DropdownMenu right>
                    {this.state.languages.map((value, index) =>
                        <DropdownItem key={value.code} onClick={() => {

                            console.log("hgfhgf")
                        }}>
                            <ReactCountryFlag code={value.code} svg/> {value.name}
                        </DropdownItem>
                    )}
                </DropdownMenu>
            </UncontrolledDropdown>

        );
    }
}
const mapDispatchToProps = dispatch => {
    return bindActionCreators(
        {
            getUsers,addUser
        },
        dispatch
    );
};

const mapStateToProps = state => {
    return state
};

export default connect(mapStateToProps, mapDispatchToProps)(ThemeNavbar);
